import UserForm from '../components/users/UserForm';
 const  Adduser=()=> {
    const [options, setOptions] = useState([]);
    useEffect(() => {
        let arr = [];    
        for (var i = 0; i < 121; i++) {
            arr.push(i)
            //console.log(options)
        }
        setOptions(arr)
     //   console.log(arr)
    }, [])
   // console.log(options)
    return (
        <>
            <h1>Add User !!!</h1>
            <UserForm options={options} />
        </>
    )
}
export default Adduser;
